import React from 'react';
import { useData } from '../../Context/DataContext';
import { Link, useNavigate } from 'react-router-dom';

const Attribution = () => {
  const { attributions, employees, equipment, setAttributions } = useData();
  const navigate = useNavigate();

  const handleReturn = (id) => {
    const updatedAttributions = attributions.map(attr => {
      if (attr.id_attribution === id) {
        return { ...attr, date_retour: new Date().toISOString().split('T')[0] };
      }
      return attr;
    });
    setAttributions(updatedAttributions);
  };

  const getEmployeeName = (id) => {
    const emp = employees.find(e => e.id_employee.toString() === id.toString());
    return emp ? `${emp.prenom} ${emp.nom}` : 'Unknown';
  };

  const getEquipmentDetails = (id) => {
    const eq = equipment.find(e => e.id_materiel.toString() === id.toString());
    return eq ? `${eq.type_materiel} (${eq.marque})` : 'Unknown';
  };

  return (
    <div className="attribution-page">
      <div className="flex justify-between items-center mb-8">
        <h1 className="text-2xl font-bold">Equipment Assignments</h1>
        <Link to="/attribution/assign" className="btn-primary">
          Assign Equipment
        </Link>
      </div>

      <div className="overflow-x-auto">
        <table className="w-full">
          <thead>
            <tr className="bg-gray-200">
              <th className="px-4 py-2">Employee</th>
              <th className="px-4 py-2">Equipment</th>
              <th className="px-4 py-2">Assignment Date</th>
              <th className="px-4 py-2">Return Date</th>
              <th className="px-4 py-2">Actions</th>
            </tr>
          </thead>
          <tbody>
            {attributions.map(attr => (
              <tr key={attr.id_attribution} className="border-b">
                <td className="px-4 py-2">{getEmployeeName(attr.id_employee)}</td>
                <td className="px-4 py-2">{getEquipmentDetails(attr.id_materiel)}</td>
                <td className="px-4 py-2">{attr.date_attribution}</td>
                <td className="px-4 py-2">{attr.date_retour || 'Not returned'}</td>
                <td className="px-4 py-2">
                  {!attr.date_retour && (
                    <button 
                      onClick={() => handleReturn(attr.id_attribution)}
                      className="btn-secondary"
                    >
                      Mark Returned
                    </button>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* FAQ Section */}
      <section className="mt-12">
        <h2 className="text-xl font-bold mb-4">Assignment Management FAQ</h2>
        <div className="space-y-4">
          <div>
            <h3 className="font-semibold">How to assign equipment?</h3>
            <p>Click on "Assign Equipment" button and select employee and equipment.</p>
          </div>
          <div>
            <h3 className="font-semibold">How to mark equipment as returned?</h3>
            <p>Click "Mark Returned" button next to the assignment.</p>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Attribution;
